import React from 'react';
import { Link } from 'react-router-dom';

export default function Login() {
    return (
        <>
            <h4>Login</h4>
            <input type="text" placeholder="username" /><br />
            <input type="text" placeholder="password" />
            <Link to="#"><p>New user? Sign up here</p></Link>
            <button>Login</button>
        </>
    )
}
